INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 1.4, "春咲 ひより", 1001, 1, 0, "お！\nあそこに困ってそうな人発見！", 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "みんなみたいに\nわたしも強くならなきゃ", 2, 1.4, "草野 優衣", 1002, 1, 0, "大切な人を\n守れるようになりたい…って", 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "フェンシングを始めてみては？", 2, 1.4, "士条 怜", 1003, 1, 0, "キミに必要な集中力と感性が", 0, 0, "少しは磨かれると思いますよ。", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ねぇ、にいちゃん！", 2, 1.5, "穂高 みそぎ", 1004, 1, 0, "今日はなにして遊ぶ？", 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "風宮あかりです", 2, 1.4, "風宮 あかり", 1006, 1, 0, "ねぇ…", 0, 0, "私といっしょに…\nいかない？", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "出雲宮子なのー", 2, 1.5, "出雲 宮子", 1007, 1, 0, "プリンたべたいのー", 0, 0, "食べ物の恨みは怖いのー", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ボクは虹村雪。", 2, 1.4, "虹村 雪", 1008, 1, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 0, "いいよ。\n見られることは運命さ…", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "フッ…聞いて後悔するがいい！", 2, 1.4, "柊杏奈", 1009, 1, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 0, "人呼んで「疾風の冥姫」!!", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "マホマホ王国のプリンセス、\nまほ姫どす", 2, 1.5, "姫宮 真歩", 1010, 1, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 0, "ほんまおおきにやわ～♪", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "衣之咲璃乃です！", 2, 1.4, "衣之咲 璃乃", 1011, 1, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 0, "ここで会ったが\n100年目～！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 1.4, "柏崎 初音", 1012, 1, 0, "ち、超能力って…\n何のことかな～？", 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ちょす！\n美波鈴奈だよ～♪", 2, 1.4, "美波 鈴奈", 1016, 1, 0, "一応カリスマ読モJKやってまっす！", 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "はいたーい。\n喜屋武香織さー。", 2, 1.4, "喜屋武 香織", 1017, 1, 0, "東京は遊園地みたいなところさー", 0, 0, "でも、沖縄もとってもいいとこさー", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "支倉伊緒です。", 2, 1.4, "支倉 伊緒", 1018, 1, 0, "先生って呼ばれるのは\nくすぐったいから", 0, 0, "イオちゃんって呼んでね。", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 1.5, "茜 ミミ", 1020, 1, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 0, "ミミをおいてかないでぇ～", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 1.5, "栗林 くるみ", 1021, 1, 0, "あの……\nふぇ……", 0, 0, "ふぇぇぇぇぇん……", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "風宮よりです。\nあああああ！", 2, 1.4, "風宮 より", 1022, 1, 0, "こんな私に貴重な時間を\n割いていただき、", 0, 0, "なんてありがとうございます！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 1.5, "北条 綾音", 1023, 1, 0, "おにいちゃんどこいくの？\nえ？", 0, 0, "私こっち行きたいー\nね、早く早くー", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "わっ…わっ…私、\n天野すずめといいます！", 2, 1.4, "天野 すずめ", 1025, 1, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 0, "これて何か違う…\nあああすみません！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "……クスクス…私は\n…倉石恵理子……", 2, 1.4, "倉石 恵理子", 1027, 1, 0, "あなたは…運命の……\n伴侶……", 0, 0, "離しませんわ………\n絶対に…!!", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 1.4, "佐々木 咲恋", 1028, 1, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 0, "…そうでしょ？？", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "桜井望だよ！\nよろしくねっ", 2, 1.4, "桜井 望", 1029, 1, 0, "ぇっと…\nキミ、私のこと知らないの?!", 0, 0, "あはは、\n私もまだまだだなぁ～", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "デケデケデンっ！", 2, 1.4, "ニノン・ジュベール", 1030, 1, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "上喜しのぶです。\n手元のドクロが父です。", 2, 1.4, "上喜 しのぶ", 1031, 1, 0, "でもって私の隣にいるのが……\nえ、見えない？", 0, 0, "おかしいですね……", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "目指すはビッグな\nお笑い芸人だっぺ！", 2, 1.5, "野戸まひる", 1033, 1, 0, "けんども\nそれには足りないモンが…", 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 1.4, "綾瀬 ゆかり", 1034, 1, 0, "ちょっと緊張しちゃって…", 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "氷川鏡華…です", 2, 1.5, "氷川 鏡華", 1036, 1, 0, "知らない人とは話しちゃいけないので", 0, 0, "これ以上お話しすることは…\nないです！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "柏崎…栞です。", 2, 1.4, "柏崎 栞", 1038, 1, 0, "……あ、アラーム。", 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "ふ、双葉碧です。", 2, 1.4, "双葉 碧", 1040, 1, 0, "私、一人も友達がいなくて……", 0, 0, "野に咲く花が、\n唯一の話相手です。", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "三角千歌です。", 2, 1.4, "三角 千歌", 1042, 1, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 0, "そう思っています。", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "安芸真琴だ。", 2, 1.4, "安芸 真琴", 1043, 1, 0, "あぁ？\nお前のそいつの仲間か？", 0, 0, "う、疑ってすまなかったな…", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "わらわこそは夜を総べる者！", 2, 1.4, "イリヤ・オーンスタイン", 1044, 1, 0, "生けとし生ける全ての者よ！", 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "そこで騎士は妖精を乱暴に……", 2, 1.4, "遠見 空花", 1045, 1, 0, "ぐふふふふ……はっ！", 0, 0, "ｌク、クウカに何かご用ですか!?", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 1.4, "宮坂たまき", 1046, 1, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "大神美冬よ！", 2, 1.4, "大神 美冬", 1048, 1, 0, "それでは早速クエストに…", 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "星野静流だよ！", 2, 1.4, "星野静流", 1049, 1, 0, "クエストもバトルも\n掃除も洗濯も", 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "アタシは玉泉美咲。", 2, 1.5, "玉泉美咲", 1050, 1, 0, "見ての通りの\nセクシー美少女で", 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "？？？", 2, 1.4, "リマ", 1052, 1, 0, "？？？？", 0, 0, "？？？？", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1.5, "モニカ・ヴァイスヴィント", 1053, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1.5, "ペコリーヌ", 1058, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1.5, "コッコロ", 1059, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
INSERT INTO `v1_4afa4c7e01488c9dbd6be00e20fbb8d45154ab706de84e7cc60ae73663eb5e53` VALUES (0, 0, 1, "モニカ・ヴァイスヴィントだ。", 2, 1.5, "キャル", 1060, 1, 0, "菓子でつろうなどと\n稚拙な策を……", 0, 0, "そ、そこまでいうなら\nもらってやる", 1);
